namespace Shine
{
	/** 任务执行方式类型(generated by shine) */
	export class QuestExecuteType
	{
		/** 需要全部执行完(无顺) */
		public static All:number=0;
		
		/** 需要串行执行 */
		public static Serial:number=1;
		
		/** 任意一个执行成功就算完成 */
		public static Either:number=2;
		
		/** 长度 */
		public static size:number=3;
		
	}
}
